# https://dmoj.ca/problem/compress
# Simple hexadecimal solution
# Note: we can reduce by compressing to utf-8 instead of hex

import sys

sys.set_int_max_str_digits(0)

code = ""
n = 2**16

mp = {"a": "00", "b": "01", "c": "10"}
rev_mp = {}
for k,v in mp.items():
    rev_mp[v] = k

def encode(txt):
    res = []
    for char in txt:
        res.append(mp[char])
    res = "".join(res)
    return str(hex(int(res, 2)))

def decode(txt):
    res = []
    txt = bin(int(txt, 16))[2:].zfill(n*2)
    for i in range(0, len(txt), 2):
        res.append(rev_mp[txt[i:i+2]])
    return "".join(res)


print(decode(code))

